function ImagePopup( {card} ) {
  return (
    <div className="popup popup_place" id="popup-place-info">
      <div className="popup__container-place">
        <button className="popup__button-close" id="popup-confirm-info" type="button"></button>
        <img src={card.link} className="popup__place-img" alt="" />
        <p className="popup__place-title"></p>
      </div>
    </div>
  )
}
export default ImagePopup;
